- VSCode Version: 1.3.0-insider
- OS Version: Windows 10 Home

![Gif](https://gyazo.com/d5e7694b12d7b1dc46346e98effea98f.gif)

Steps to Reproduce:
1. Open a folder with special characters;
2. Try to open the integrated Terminal;

- VSCode Version: VS Code 1.29.1
- OS Version: Debian 4.9.130-2

Steps to Reproduce:

1. Create 3 files in the same folder and open that folder in VS Code: main.c inc0.h inc1.h
2. Include the two header files to the main.c file
3. Use include guards to prevent multiple inclusions of header files and use the same variable in both header files to guard it
4. Fill the inc1.h file with valid c code of about 30 lines length

here are example contents

main.c
```
#include "inc0.h"
#include "inc1.h"

#ifndef TEST0
#define TEST0

#endif // TEST 0

/*
 * \brief something something
 */
int main() {
    return 0;
}
```

inc0.h:
```
#ifndef TEST0
#define TEST0

    /* comment something */
    void function0() {
        int y = 0;
    }

#endif // TEST0
```

```
inc1.h
