```

5. Switch between open tabs of the files. The content of the inc1.h file will start to flash, formating will be broken and other gui elements of the gui will start going black. Navigating the code is not possible and the gui seems to be just before crashing.

Launching code with --disable-extensions does not change the behavior

Issue Type: <b>Bug</b>

The TypeScript language service died 5 times right after it got started. The service will not be restarted.
Version: 1.41.1 (system setup)
Commit: 26076a4de974ead31f97692a0d32f90d735645c0
Date: 2019-12-18T14:58:56.166Z
Electron: 6.1.5
Chrome: 76.0.3809.146
Node.js: 12.4.0
V8: 7.6.303.31-electron.0
