Issue Type: <b>Bug</b>

 Please fill in the sections below to help us diagnose the issue 

**TypeScript Version:** 4.1.1-rc

**Steps to reproduce crash**
1. Install the Deno extensions.
2. Open a new folder.
3. Setup a launch.json with Deno debug attach (the extension has a template for that).
4. Create a TypeScript file with a function and call it.
