class ParsingError extends Error {
  constructor(message: string, public readonly from: Token, public readonly to: Token) {
    super(message);
  }
}

export class Parser {
  private readonly _tokens: TokenStream;
  private _hadError: boolean = false;

  constructor(tokens: readonly Token[]) {
    this._tokens = new TokenStream(tokens);
  }

  get hadError() {
    return this._hadError;
  }

  reportError(message: string, from: Token, to: Token): void;
  reportError(error: ParsingError): void;
  reportError(messageOrError: string | ParsingError, from?: Token, to?: Token) {
    if (messageOrError instanceof ParsingError) {
      this.reportError(messageOrError.message, messageOrError.from, messageOrError.to);
    } else {
      console.error(
        `Compile error: ${messageOrError}.
From line ${from!.start.row}, column ${from!.start.column} to line ${to!.end.row}, column ${to!.end.column}.`);
      this._hadError = true;
    }
  }

  match(kind: TokenKind) {
    return this._tokens.peek()?.kind === kind;
  }

  consume(kind: TokenKind) {
    if (this.match(kind)) {
      this._tokens.advance();
      return true;
    } else {
      return false;
    }
  }

  expect<Kind extends TokenKind>(kind: Kind, message: string): PickToken<Kind> {
    const token = this._tokens.peek();
    if (token === undefined) {
      throw new ParsingError(message, this._tokens.peek(-1)!, this._tokens.peek(-1)!);
    }
    if (token.kind === kind) {
      this._tokens.advance();
      return token as PickToken<Kind>;
    } else {
      throw new ParsingError(message, token, token);
    }
  }

  parseExpression(precedence?: Precedence): Expr {
    precedence ??= Precedence.Lowest;

    let token = this._tokens.advance();
    if (token === undefined) {
      throw new ParsingError('Expected an expression', this._tokens.peek(-1)!, this._tokens.peek(-1)!);
    }
    const prefix = PREFIX_PARSELETS.get(token.kind);
    if (prefix === undefined) {
      throw new ParsingError(`Could not parse '${token.lexme}'`, token, token);
    }

    let left = prefix.call(this, token);

    while ((token = this._tokens.advance()) !== undefined) {
      const infix = INFIX_PARSELETS.get(token.kind);
      if (infix === undefined || infix.precedence <= precedence) {
        break;
      }
      left = infix.parselet.call(this, infix.precedence, left, token);
    }

    return left;
  }

  parse(): Expr | null {
    try {
      return this.parseExpression();
    } catch (e: unknown) {
      if (e instanceof ParsingError) {
        this.reportError(e);
      }
      return null;
    }
  }
}
